export class PagingQueryInfo {
    constructor(pageSize, pageNumber) {
        this.pageNumber = pageNumber;
        this.pageSize = pageSize;
    }
}
export class PagingQueryResult {
    constructor(pageSize, pageNumber, count, hasMoreResults, results) {
        this.pageNumber = pageNumber;
        this.pageSize = pageSize;
        this.count = count;
        this.results = results;
        this.hasMoreResults = hasMoreResults;
    }
}
